"""
    Given a list of integers, write a function that returns the largest sum of non-adjacent numbers.Numbers can be 0 or negative.
    For example, [2, 4, 6, 2, 5] should return 13, since we pick 2, 6, and 5. [5, 1, 1, 5] should return 10, since we pick 5 and 5.
    Follow-up: Can you do this in O(N) time and constant space?
"""

def help(arr, i, mem):
    if i in mem:
        return mem[i]
    if i >= len(arr):
        return 0
    two = help(arr, i + 2, mem)
    three = help(arr, i + 3, mem)
    res = 0
    if two > three:
        res = arr[i] + two
    else:
        res = arr[i] + three
    mem[i] = res
    return res

def max_count(arr):
    mem = {}
    first = help(arr, 0, mem)
    second = help(arr, 1, mem)
    if first > second:
        return first
    else:
        return second

print(max_count([2,4,6,2,5]))
print(max_count([5,1,1,5]))
